import React from "react";
import "./header.scss";

const Header = () => {
  console.log("este es mi Header");
  return (
    <div>
      <header>
        <div
          className="head"
          style={{
            backgroundImage: `linear-gradient(to top,
      rgba(223, 137, 181, 0.349) 0%,
      rgba(191, 217, 254, 0.212) 100%`,
          }}
        >
          <nav className="uno">
            <a href="#">Inicio</a>
            <a href="#">Contacto</a>
            <a href="#">
              My Car <i className="fas fa-shopping-cart"></i>
            </a>
          </nav>
          <div>
            <h1>PIJAMAS</h1>
          </div>
        </div>
      </header>
    </div>
  );
};

export default Header;
